import React from 'react';
import { Link } from 'react-router-dom';
import './CSS/ActorCard.css'


const ActorCard = ({ actor }) => {
  const showDetailPath = `/actors/${actor.nconst}`; // Assuming you have a unique identifier for each show


  return (
    <Link to={showDetailPath} className="show-card">
    <div className="actor-card">
      <h4>{actor.primaryName}</h4>
      <p>Birth Year: {actor.birthYear}</p>
      <p>Death Year: {actor.deathYear}</p>
      <p>Primary Profession: {actor.primaryProfession}</p>
    </div>
    </Link>
  );
};

export default ActorCard;
